INSERT INTO `preguntas` VALUES (1,'El hombre <b>expió</b> sus culpas en la <b>orca</b> por los daños de sus <b>búhos</b> y no <b>baciló</b> al morir.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(2,'El <b>caballo</b> <b>bayo</b> hizo una <b>corveta</b> en la <b>hierba</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(3,'La <b>vaca</b> del auto de <b>Raul</b> <b>bale</b> para transportar <b>poyos</b> y gallinas.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(4,'<b>As</b> de saber que <b>tú</b> casa es de <b>tu</b> hermana y de <b>el</b>.',NULL,'2022-05-18 19:34:35','2022-06-09 18:07:58'),(5,'<b>Saves</b> <b>bien</b> que puedes <b>errar</b> al <b>herrar</b> el caballo y lastimarlo.',NULL,'2022-05-18 19:34:35','2022-05-31 22:57:45'),(6,'Quiero <b>grabar</b> <b>esta</b> cinta para saber <b>quien</b> me comprará este <b>bello</b> recuerdo.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(7,'Hizo <b>jirar</b> el <b>has</b> de <b>bastos</b> y <b>rebeló</b> que el juego es puro azar.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(9,'Para que <b>de</b> la comida de la <b>hoya</b>, tienes que hablar con la <b>baronesa</b> de Barcelona de tus <b>vienes</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(10,'Era una <b>vasta</b> <b>estensión</b> con <b>vacas</b> y <b>pollos</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(11,'Quiere que <b>vaya</b> a saltar la <b>valla</b> y a comerme una <b>baya</b> en un <b>vallado</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(12,'<b>Ahí</b> <b>hay</b> un hombre que dice <b>¡ay!</b>, <b>hasta</b> llorar.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(13,'Quizás <b>aya</b> alguien que <b>halla</b> <b>hecho</b> un <b>ataud</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(14,'El <b>cayo</b> de <b>mi</b> <b>pié</b> hace que me ponga una <b>maya</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(15,'<b>Viviamos</b> en una <b>villa</b> que <b>todabía</b> no tenía <b>televisión</b>.',NULL,'2022-05-18 19:34:35','2022-08-10 21:44:48'),(16,'¿<b>Porqué</b> fue? <b>Si</b> lo <b>se</b>, <b>te</b> lo diré.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(17,'<b>Más</b> o menos <b>rallado</b> estaba el <b>aúto</b> de <b>Saúl</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(18,'<b>Dé</b> aquí a <b>Bilbado</b> <b>esisten</b> tres <b>atajos</b> para ir más deprisa.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(19,'La enfermedad <b>vascular</b> es muy importante es el <b>area</b> del <b>seso</b> del <b>selebro</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(20,'La <b>extirpe</b> de los <b>maometanos</b> <b>probiene</b> de <b>Maruecos</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(21,'<b>¿¡</b>Qué el <b>vello</b> es <b>bello</b>!? Te burlas de mí, eres un poco <b>bellaco</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(22,'Su <b>pasagera</b> visita a Roma con un <b>monge</b> amigo reafirmó sus <b>convicciones</b> religiosas. Renovó sus <b>votos</b> tras una crisis de fe.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(23,'<b>Dignidad</b>, <b>providad</b> y <b>sacrifisio</b> son la <b>idiosincracia</b> de un buen agente de la ley.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(24,'La economía de Europa del Este determinará el <b>alcance</b> de la crisis. Los <b>países</b> en <b>vias</b> de desarrollo son el <b>termómetro</b> de Europa en este sentido.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(25,'<b>Tegía</b> una <b>vufanda</b> para que su nieto se <b>protejiera</b> durante el <b>invierno</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(26,'El sur de Argentina es un buen lugar para ver <b>pingüinos</b>. ¿No es <b>este</b> tu animal <b>favorito</b>? Es un lugar un tanto <b>exótico</b> que podríamos visitar.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(27,'Trajo una <b>hamalgama</b> de productos de su pueblo que <b>inclulle</b> varios <b>embutidos</b> <b>deliciosos</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(28,'En el <b>embalaje</b> puso los <b>mejunjes</b> y las <b>pastillas</b> para engordar, estaba <b>flamélico</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(29,'Cuando el <b>valido</b> se <b>rebeló</b>, el <b>Rey</b> se sintió traicionado. ¡Le confió la educación de su <b>primogénito</b> a un traidor!',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(30,'Está <b>abatido</b> por la muerte de su perro. <b>Ojala</b> <b>tuviera</b> una <b>varita</b> mágica para que pudiera volver a tenerlo bien.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(31,'Llegaron al <b>aeropuerto</b> de Valladolid casi a <b>media noche</b>. <b>Félix</b> se puso contento cuando vio que su mujer había ido a <b>recogerlos</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(32,'Deja que coma <b>fabada</b> hasta que se <b>harte</b>. Todavía no es <b>cosciente</b> de que su <b>tuvo</b> digestivo es muy delicado.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(33,'Su <b>cayado</b> era símbolo de autoridad. Cuando lo <b>herguía</b> para señalar a alguna de sus hijas todas <b>temblaban</b>. El <b>pabor</b> se apoderaba de ellas.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(34,'Ahora <b>erguimos</b> nuestra copa para brindar por los novios. Como dice la canción: \"Que la felicidad les <b>atropeye</b>\". Que corra el <b>brandi</b> y el <b>coñac</b> para celebrar.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(35,'En ese momento delicado a Trajano puedes admirar la <b>brabura</b> y el <b>coraje</b> de los emperadores romanos. Eran <b>valientes</b> y <b>orgullosos</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(36,'Me <b>abolló</b> la moto nueva intentando aparcar como un <b>proyectil</b> junto a la iglesia. El año pasado también me <b>rayó</b> el coche. ¡<b>Cómo</b> puede ser tan desastroso!',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(37,'<b>Vienes</b>, traes tus <b>ignotos</b> <b>bienes</b> e intentamos llegar a un acuerdo con <b>ahinco</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(38,'Es <b>hacendoso</b>, <b>vizarro</b>, <b>esbelto</b> y <b>hoptimista</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(39,'En el <b>haquelarre</b>, la <b>hechicera</b> logró que se separaran. Sus malas artes son conocidas por todos gracias a los poemas del <b>bate</b>, pero sigue engañando a la gente del <b>ampa</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(40,'El mejor concierto que vi nunca fue el de <b>Heroes</b> del <b>silencio</b>. Invité a mi <b>ahijada</b> porque era su banda <b>favorita</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(41,'Un <b>hadagio</b> es una especie de refrán, un <b>proverbio</b> que encierra una <b>sabia</b> enseñanza que nos sirve para el <b>porvenir</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(42,'Creo que <b>cavila</b> fatal porque camina por el <b>harcén</b> sin chaleco reflectante. Cualquier día que regrese de <b>bagar</b> el lino le atropellarán. Que <b>valla</b> con cuidado.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(43,'Abusa de su <b>lavia</b> por <b>inhercia</b>, pero algún día esa táctica de <b>Donjuan</b> dejará de funcionarle. Tarde o temprano, se enamorará y sufrirá como todas las mujeres a las que <b>engatusó</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(44,'Los <b>Ministerios</b> de <b>Educación</b> y <b>Cultura</b> se fusionaron hace años en un solo. No <b>sé</b> si fue un acierto, la verdad.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(45,'La <b>hoya</b> para el cultivo del tomate era demasiado profunda. Le salieron plantas muy <b>hojosas</b> con el fruto <b>arrás</b> de suelo. Si comes estos tomates, <b>lavatelos</b> muy bien antes.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(46,'En el <b>vote</b> <b>salva-vidas</b> los niños gritaban, pero sus madres estaban igual de asustadas. Miraban las <b>bollas</b> para saber si llegaba alguien en su <b>ayuda</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(47,'El atleta <b>hojeó</b> el ambiente escondido en el <b>vomitorio</b> para templar sus nervios antes de salir a competir. Sus <b>adversarios</b> <b>horaban</b> o escuchaban música.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(48,'La <b>savia</b> de las plantas es como nuestra sangre. A veces usamos esta palabra para referirnos a algunos líquidos <b>exudados</b> por las plantas, como el <b>latex</b> o la <b>recina</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(49,'Era un <b>deprabado</b> que cada vez <b>avivaba</b> más el odio de su pueblo debido a sus <b>incoherencias</b> e injustas <b>desisiones</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(50,'El <b>bao</b> del barco quedó seriamente afectado tras el <b>huracán</b>. Una <b>basta</b> extensión de la cubierta <b>hubo</b> de ser reparada.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(51,'Los mineros encontraron una <b>veta</b> interesante, pero su intento de explotación se <b>abortó</b> porque también detectaron <b>grisu</b>. El capataz <b>convino</b> con sus hombres no continuar.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(52,'<b>Oyó</b> abrirse una puerta y <b>vió</b> que el <b>humbral</b> de la misma era atravesado por su amigo <b>costariquense</b> que hacía años que no veía.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(53,'Desapareció en los <b>fíordos</b> porque se desvió del camino en una <b>excursión</b>. Cuando lo hallaron, estaba <b>helado</b> y <b>avergonzado</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(54,'Toca el <b>xasofón</b> desde <b>1.977</b>. Que nadie <b>hose</b> retarle con este <b>instrumento</b>, es un genio.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(55,'Los <b>fanes</b> le pidieron más <b>bises</b> y ellos, con enorme <b>satisfación</b>, volvieron al <b>proscenio</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(56,'Aunque ahora <b>sonríe</b> <b>ruborizado</b> cuando le pre