022-05-18 19:34:35'),(205,'Yo <b>ablande</b> el corazón de la muchacha cuando le <b>relate</b> mis aventuras como <b>voluntario</b> y la <b>empatía</b> que demuestran.',NULL,'2022-05-18 19:34:35','2022-07-31 19:06:52'),(206,'Me gusta el campo aunque el <b>balar</b> de las <b>ovejas</b> sea mi despertador, junto con el <b>gallo</b> y las <b>abejas</b> que zumban.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(207,'<b>Hojeó</b> la escena del <b>crímen</b> <b>excrutando</b> todo <b>escrupulosamente</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(208,'Cuando el agua <b>hierba</b>, añádele la <b>hierva</b> medicinal que te preparé mezclando <b>salvia</b> y <b>jengibre</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(209,'Puede que esos <b>grabados</b> sean de Goya y que lleven más de cien años enterrados entre <b>grava</b> y <b>cachibaches</b>. ¡Qué <b>vergüenza</b>!',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(210,'Cuando sacaron la <b>malla</b> del mar encontraron un <b>abadejo</b> y unas cuantas <b>cigalas</b>, pero también bolsas, latas y <b>resíduos</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(211,'No puede <b>injerir</b> determinados alimentos hasta que pasen 72 horas. Le espera una <b>honda</b> recuperación de su <b>cirujía</b> en los próximos <b>días</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(212,'Habla <b>Inglés</b> y <b>Alemán</b> perfectamente, por eso obtuvo el puesto tras la primera <b>interviú</b>. Aunque ahora tiene que trabajar a 1000 <b>kms</b> de su casa.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(213,'Se dedica al <b>extraperlo</b>, de ahí que lo hayan <b>hapresado</b> alguna vez. Su madre está <b>aflijida</b> y su padre dice que es la <b>deshonra</b> de la familia.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(214,'Cierra <b>a calicanto</b> antes de irte de vacaciones y sigue <b>a rajatabla</b> las recomendaciones de la policía. Los ladrones <b>acechan</b> y saben todos los movimien