/b> y ahora es un hombre nuevo que no <b>trasgrede</b> las normas y <b>reacciona</b> bien ante cualquier problema.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(225,'Su hogar es un <b>búnker</b>, tiene grandes medidas de seguridad, desde la <b>oxidada</b> <b>verja</b> de entrada hay cámaras y sensores de <b>movimiento</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(226,'El <b>expolio</b> está detrás de la historia de muchos templos, reliquias, patenas y <b>cálices</b> a lo largo de la <b>geografía</b> española. Hay que poner <b>empeño</b> para resolver esos casos.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(227,'El cura <b>absolbió</b> al penitente que <b>invernaba</b> en su parroquia a pesar de que su incontrolable <b>líbido</b>, le haría sin duda volver a pecar. Es un hombre <b>advenediso</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(228,'<b>Ahumar</b> y salar pescado ha sido clave para su economía. La <b>autarquía</b> en la que viven desde hace años limita su alimentación. No tiene un <b>ápice</b> de <b>variedad</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(229,'¿No sabes hacer <b>funciones</b>? El <b>eje</b> <b>horizontal</b> es el de <b>abcisas</b>. El vertical, es el de ordenadas.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(230,'Sin <b>almibar</b> no saben igual estos dulces. Con tu <b>beneplácito</b> usaré tus <b>enceres</b> para ponerlos un poco. Luego lo <b>friego</b> todo.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(231,'La oración tenía diptongo <b>y</b> <b>hiato</b>, por lo que contesté <b>acertadamente</b> la pregunta planteada en el <b>test</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(232,'¿El <b>vencejo</b> es un <b>ave</b> que se alimenta de <b>insectos</b>? Lo <b>oí</b> en la radio.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(233,'En el laboratorio <b>combinamos</b> <b>substancias</b> hasta dar con una fórmula válida. La ponemos en un <b>espray</b> y la testamos en animales. El <b>jiennense</b> Sebastián Padrón ha conseguido patentar ya algunos productos.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(234,'Sus galletas de <b>gengibre</b> son famosas en toda la comunidad. En <b>Navidades</b> hace unas cuantas para todos los vecinos. Como es <b>bloguera</b>, saca fotos de los vecinos recibiendo el presente para su <b>bitácora</b> virtual.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(235,'En el siglo <b>21</b> empezaron sus carreras 4 <b>ó</b> 5 autores que en mi opinión, podrían ser los intelectuales por <b>antonomasia</b> de los próximos <b>lustros</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(236,'Tiene una inconfundible <b>propensión</b> a <b>tergiversar</b> las cosas. La última vez montó un jaleo tan grande por un malentendido que el <b>gerente</b> del <b>apartotel</b> en el que nos hospedábamos nos llamó la atención.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(237,'El <b>mogigato</b> que nos atendió en <b>recepción</b> nos dijo que nuestra habitación <b>inclulle</b> desayuno, pero no nos dio la clave del <b>wi fi</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(238,'Los <b>estivadores</b> protagonizaron una lucha muy intensa en los <b>90s</b>, y por eso ahora sus condiciones laborales son mejores que las de otros <b>colectivos</b>. Las camareras de piso de los hoteles deberían hacer <b>exactamente</b> lo mismo.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(239,'<b>Preveyendo</b> la actividad económica del próximo trimestre, creo que lo mejor será invertir en empresas creadoras de aplicaciones. ¿A <b>ti</b> te parece una buena apuesta? Nos haría falta hablar inglés en lugar de <b>spanglish</b>, eso <b>sí</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(240,'Me encantó el <b>zoológico</b> <b>australiano</b>, no había visto un <b>armadillo</b> o un <b>ornitorrinco</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(241,'Solo compré un <b>comic</b>. El nuevo <b>guion</b> de mi autor favorito está triunfando en todos lados. <b>Fui</b> demasiado tarde y estaba agotado. <b>Ojee</b> obras de nuevos autores muy interesantes.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(242,'Es imposible dormir con el <b>mayar</b> de los gatos. Si no paran de <b>maullar</b> tendré que sacarlos de casa, pero hace tanto <b>frío</b> que me da pena. Si mañana siguen así, me tomaré un <b>somnífero</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(243,'Pasamos unos días <b>increibles</b> en el mejor <b>cayo</b> de México. Una vez terminadas las vacaciones me <b>encobaré</b> hasta la fecha del <b>exámen</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(244,'Con una <b>olla</b> de <b>callos</b> podemos comer todos los comensales. De <b>hecho</b>, me parece <b>demasíada</b> comida.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(245,'La <b>corbeta</b> atracó en el <b>Puerto</b> de la ciudad la semana pasada. Es un <b>buque</b> imponente que se puede <b>visitar</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(246,'<b>Bota</b> los <b>desechos</b> al contenedor y prepara las <b>llantas</b> para llevarlas al <b>desguace</b>. Reciclemos todo cuanto podamos.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(247,'Se <b>revela</b> porque quiere un <b>hestipendio</b> más elevado. Le da <b>corage</b> que su peculio sea tan <b>escaso</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(248,'Cuando <b>recave</b> toda la información necesaria sobre el <b>master</b> decidiré <b>si</b> me matriculo en 3 <b>ó</b> 4 asignaturas.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(249,'Si <b>rallas</b> un limón en la masa del <b>biscocho</b> te quedará más sabroso. Termínalo antes de las <b>séis</b>, así lo podremos <b>aviar</b> para el viaje.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(250,'En su huerto urbano quiere sembrar <b>acedera</b> por sus propiedades, además de <b>habas</b>, <b>acelgas</b> y espinacas para los <b>potages</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(251,'<b>Abita</b> el cabo de la <b>chalana</b> para poder sacar la pesca de hoy. ¿Habían visto una <b>corbina</b> tan grande y una <b>lubina</b> tan apetitosa?',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(252,'El <b>acerbo</b> cultural de ese pueblo se mantiene gracias <b>ha</b> que sus vecinos saben conservar las tradiciones sin renunciar a la tecnología. Tiene un <b>blog</b> para hablar de su <b>folclor</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(253,'<b>Saumó</b> la iglesia y limpió las esculturas con <b>ternísimo</b> cuidado. Aunque no le tocaba trabajar ese día, <b>transijió</b> y accedió a la petición del <b>ravino</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(254,'Los futbolistas del rival parecían <b>queruvines</b>, modelos. Los vieron dirigirse al <b>bestuario</b> confiando en que el partido no finalizara con un duro <b>varapalo</b>. Para colmo, antes del encuentro tuvieron que oír el <b>baniloquio</b> de su entrenador.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(255,'<b>Rehuyen</b> la polémica, pero saben que ha habido un <b>savotaje</b> dentro de la propia empresa. Ha sido un fallo <b>tribial</b>, que ha atacado nuestro <b>novísimo</b> sistema informático.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(256,'Tiene un <b>hepatante</b> <b>ruivarbo</b> en su jardín, junto a una <b>amberca</b>. Todo ello le da un hermoso ambiente <b>bucólico</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(257,'Tragué <b>saliva</b> cuando vi en el zoológico la hermosura de ese <b>rebeco</b>. Valió la pena el largo viaje en el <b>talgo</b> para llegar hasta aquí. Lástima que el pequeño Andrés no haya podido venir por la <b>baricela</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(258,'El <b>siquiatra</b> me explicó por qué ando bajo de ánimos. No entendí nada cuando empezó a hablarme de <b>hendorfinas</b>, <b>cerotonina</b> y <b>testoterona</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(259,'Si tiene algún problema con la <b>queratina</b>, su <b>epidermis</b> lo notará, será indicio de que algo no funciona correctamente en su organismo. A mí me parece que está hecho un <b>tarzán</b>, creo que sería capaz de mover el más pesado <b>hobelisco</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(260,'Pide que le <b>juzgen</b> ya por los cargos de <b>estorsión</b> de los que la acusan. Su moral no se <b>erosiona</b>, a pesar del <b>rebuelo</b> mediático.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(261,'Encendió la llama en el <b>pevetero</b> dedicado a los <b>caidos</b> por la patria. A continuación hubo <b>salvas</b> que acabó con una <b>ovación</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(262,'<b>Hescoró</b> la nave a <b>estrivor</b>, luego a <b>bavor</b>. Los pasajeros iban de un lado a otro del barco con tanto movimiento y uno de ellos se dañó la <b>pantorrilla</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(263,'Hermoso <b>panejírico</b> el del profesor universitario, es <b>paradicma</b> de persona de enorme <b>sapiensia</b> y <b>erudición</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(264,'Pescó un <b>rodavallo</b> y un <b>robalo</b>, que él mismo puso a <b>freír</b>. Nos lo comimos debajo de la <b>savina</b> que hay en su casa.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(265,'El médico <b>austríaco</b> me miró el <b>iris</b> y en seguida me dijo que tengo <b>presvicia</b>. Pensé que se curaría con una intervención <b>quirúrjica</b>, pero no es así.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(266,'Usó un buen <b>deterjente</b> y pudo quitar la mancha que se hizo durante la fiesta de <b>carnabal</b>. Por cierto, iba <b>graciosímo</b> con su disfraz y el <b>bisoñé</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(267,'Se trata de una <b>vicoca</b>, aprovecha y <b>cómpralo</b>, es un sombrero poco <b>convencional</b>, no como la <b>vazofia</b> que te venden por ahí.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(268,'Dio un <b>traspiés</b> y tropezó con el <b>carruage</b>. Se hizo daño y dos días después le tuvieron que hacer una <b>artroscopia</b> en la <b>rodiya</b> izquierda.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(269,'Me encantan los <b>harrumacos</b> de mi hermana. Hoy le he regalado un <b>dige</b> por el que tenía <b>antojo</b> y que encontré en el <b>hatelier</b> de un amigo.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(270,'Preparó el <b>cavallete</b> para pintar un paisaje lleno de <b>buganbillas</b>, con un <b>clarens</b> al fondo. El arte es su afición, le sirve de <b>huida</b> del estrés.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(271,'Para sus investigaciones contra la enfermedad de&nbsp;<b>alzheimer</b> usa como <b>cobayas</b> algunos ratoncillos. Es <b>vecario</b> de un médico que, por lo visto, es único con el <b>visturí</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(272,'<b>Dé</b> <b>más</b> <b>tés</b> a <b>él</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(273,'Le <b>prescribieron</b> un tratamiento de <b>hidroterapia</b>. Este chico siempre tiene algo, recuerdo que también padece de <b>hiposia</b>. Ah, también es <b>hepático</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(274,'Se está haciendo mayor, ya se le ve algo de <b>bozo</b>. Tiene una interesante afición, es <b>luthier</b>, acaba de restaurar un <b>antidiluviano</b> <b>archilaud</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(275,'En la Edad Media, ser <b>herético</b> era duramente castigado. El último libro que <b>leí</b> trata de un <b>harcabucero</b> <b>brivón</b> al que persiguió la Iglesia por esta razón.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(276,'Estaba <b>chirivitas</b> ante tanta <b>aporía</b>. <b>Aquéllo</b> sí que era un enfado y no de <b>éste</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(277,'<b>Pónle</b> <b>apostrofe</b> a ese <b>palabro</b>, te lo <b>corrijieron</b> en el último examen, ¿recuerdas?',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(278,'Me encanta el <b>basquetbol</b>. Dudo si el mejor <b>pivot</b> español de todos los tiempos es Pau o Marc Gasol. Hay otros, pero no me gusta nada algunos que <b>recojen</b> rebotes con gestos <b>cirsenses</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(279,'Llegaron en un <b>calluco</b> a la costa de Tarifa. Fueron atendidos por Cruz Roja, se hallaban <b>desidratados</b>. Su <b>sino</b> es ser <b>devueltos</b> a su país de origen.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(280,'Ese <b>arcaíco</b> <b>testo</b> es <b>hapócrifo</b>. No hay <b>hipótesis</b> válida sobre su autoría.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(281,'Los biólogos <b>cabilaron</b> largo rato y llegaron a la conclusión de que ese <b>cabicornio</b> que estaba junto a la <b>caberna</b> tenía alguna extraña enfermedad. Comenzaron a estudiarlo con la <b>anuencia</b> del responsable de la expedición.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(282,'Está mal de la <b>chaveta</b>. Ha contratado un <b>boy</b> para la fiesta de cumpleaños de una niña de 17 años. Sí, Elvira <b>sólo</b> tiene 17, nació en el año <b>2.001</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(283,'Esas <b>actrizes</b> se saltan el <b>guión</b> cuando quieren. Ahora bien, <b>improvisan</b> de una manera genial. Su representante es un <b>truhán</b>, si fuese bueno, serían famosas.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(284,'Se <b>diluyeron</b> un <b>95 %</b> sus opciones de ganar el premio, <b>nisiquiera</b> aunque logre todos los <b>apollos</b> que le habían prometido sus amigos.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(285,'De aspecto <b>huero</b>, en su interior había, <b>empero</b>, <b>halgas</b> y <b>hostras</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(286,'Esa persona aparte ser <b>vitando</b>, era un <b>crack</b> en malversar, además de <b>sesecionista</b> y <b>fascineroso</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(287,'Usó <b>antisécticos</b>, pero al final fue necesaria una <b>esplenetomía</b>, <b>transfusión</b> de sangre <b>incluída</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(288,'Una columna <b>embebida</b> es <b>aquélla</b> que <b>encastra</b> en otro cuerpo parte de su <b>fuzte</b>.',NULL,'2022-05-18 19:34:35','2022-06-09 17:53:03'),(289,'<b>Recuérdale</b> a ellos <b>cualquieras</b> cosas que te parezcan interesantes para que nuestras <b>ONG</b> superen los <b>11.000</b> socios.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(290,'Es una <b>bloguera</b> de moda muy <b>afamada</b>, aunque a mí no me gusta cómo viste, siempre con <b>jeans</b> y <b>blázer</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(291,'<b>Virtió</b> agua en el <b>vacín</b> de una forma poco <b>heterodoxa</b>, se la bebió y después se dio un atracón de comida, era realmente un <b>heliogábalo</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(292,'La <b>hendija</b> en el <b>boquerel</b> apenas medía unos centímetros. Era una <b>hendidura</b> que apenas se <b>veía</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(293,'Me <b>halagan</b> y <b>ruvorizan</b> tus <b>estraños</b> <b>pretestos</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(294,'Se <b>estrañó</b> por la <b>abalancha</b> de los <b>extenuados</b> <b>transeúntes</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(295,'<b>Sabiais</b> <b>sonreir</b> para crear <b>expectativas</b> entre los <b>oyentes</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(296,'<b>Bufaba</b> porque estaba <b>exhausta</b> y <b>desvaida</b> por el fuerte <b>vendaval</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(297,'<b>Anelaba</b> <b>exhibirse</b> pero su <b>perplejidad</b> fue mayúsculas al ver la <b>gravación</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(298,'Deseé seguir con el engaño del <b>envuste</b> ya que tras el conocimiento de la verdad <b>probocó</b> en <b>mi</b>, <b>deshasosiego</b> y desconfianza.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(299,'Desde la <b>atalaya</b> se <b>observan</b> los <b>veneros</b> del <b>inóspito</b> lugar.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(300,'Es muy <b>precabido</b> y le <b>exaspera</b> la escasa <b>higiene</b> de ese <b>cachibache</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35'),(301,'Estaba <b>yermo</b> el terreno por la <b>devastación</b> del <b>orrisono</b> <b>alud</b>.',NULL,'2022-05-18 19:34:35','2022-05-18 19:34:35');
